00087     private void RequestInputFileForParentDirectory(string message)
00088     {
00089         IdeBackgroundTaskApi.InputFile.RequestInputFileStateForm(
00090             message,
00091             async absolutePath =>
00092             {
00093                 if (absolutePath is null)
00094                     return;
00095 
00096                 _viewModel.ParentDirectoryNameValue = absolutePath.Value;
00097                 await InvokeAsync(StateHasChanged);
00098             },
00099             absolutePath =>
00100             {
00101                 if (absolutePath is null || !absolutePath.IsDirectory)
00102                     return Task.FromResult(false);
00103 
00104                 return Task.FromResult(true);
00105             },
00106             new[]
00107             {
00108                 new InputFilePattern("Directory", absolutePath => absolutePath.IsDirectory)
00109             }.ToImmutableArray());
00110     }
