00125     private async Task EnqueueDotNetNewListAsync()
00126     {
00127         try
00128         {
00129             // Render UI loading icon
00130             _viewModel.IsReadingProjectTemplates = true;
00131             await InvokeAsync(StateHasChanged);
00132 
00133             var formattedCommand = DotNetCliCommandFormatter.FormatDotnetNewList();
00134             var generalTerminal = TerminalStateWrap.Value.TerminalMap[TerminalFacts.GENERAL_KEY];
00135                 
00136             var terminalCommandRequest = new TerminalCommandRequest(
00137                 formattedCommand.Value,
00138                 EnvironmentProvider.HomeDirectoryAbsolutePath.Value,
00139                 new Key<TerminalCommandRequest>(_viewModel.LoadProjectTemplatesTerminalCommandRequestKey.Guid))
00140             {
00141                 ContinueWithFunc = parsedTerminalCommand =>
00142                 {
00143                     DotNetCliOutputParser.ParseOutputLineDotNetNewList(parsedTerminalCommand.OutputCache.ToString());
00144                     _viewModel.ProjectTemplateList = DotNetCliOutputParser.ProjectTemplateList ?? new();
00145                     return InvokeAsync(StateHasChanged);
00146                 }
00147             };
00148 
00149             generalTerminal.EnqueueCommand(terminalCommandRequest);
00150         }
00151         finally
00152         {
00153             // UI loading message
00154             _viewModel.IsReadingProjectTemplates = false;
00155             await InvokeAsync(StateHasChanged);
00156         }
00157     }
