00204     private async Task StartNewCSharpProjectCommandOnClick()
00205     {
00206         if (!_viewModel.TryTakeSnapshot(out var immutableView) ||
00207             immutableView is null)
00208         {
00209             return;
00210         }
00211 
00212         if (string.IsNullOrWhiteSpace(immutableView.ProjectTemplateShortNameValue) ||
00213             string.IsNullOrWhiteSpace(immutableView.CSharpProjectNameValue) ||
00214             string.IsNullOrWhiteSpace(immutableView.ParentDirectoryNameValue))
00215         {
00216             return;
00217         }
00218 
00219         if (LuthetusHostingInformation.LuthetusHostingKind == LuthetusHostingKind.Photino)
00220         {
00221             var generalTerminal = TerminalStateWrap.Value.TerminalMap[TerminalFacts.GENERAL_KEY];
00222 
00223             var terminalCommandRequest = new TerminalCommandRequest(
00224                 immutableView.FormattedNewCSharpProjectCommand.Value,
00225                 immutableView.ParentDirectoryNameValue,
00226                 new Key<TerminalCommandRequest>(immutableView.NewCSharpProjectTerminalCommandRequestKey.Guid))
00227             {
00228                 ContinueWithFunc = parsedCommand =>
00229                 {
00230                     var terminalCommandRequest = new TerminalCommandRequest(
00231                         immutableView.FormattedAddExistingProjectToSolutionCommand.Value,
00232                         immutableView.ParentDirectoryNameValue,
00233                         new Key<TerminalCommandRequest>(immutableView.AddCSharpProjectToSolutionTerminalCommandRequestKey.Guid))
00234                     {
00235                         ContinueWithFunc = parsedCommand =>
00236                         {
00237                             Dispatcher.Dispatch(new DialogState.DisposeAction(DialogRecord.DynamicViewModelKey));
00238     
00239                             CompilerServicesBackgroundTaskApi.DotNetSolution.SetDotNetSolution(
00240                                 immutableView.DotNetSolutionModel.NamespacePath.AbsolutePath);
00241                             return Task.CompletedTask;
00242                         }
00243                     };
00244                         
00245                     generalTerminal.EnqueueCommand(terminalCommandRequest);
00246                     return Task.CompletedTask;
00247                 }
00248             };
00249                 
00250             generalTerminal.EnqueueCommand(terminalCommandRequest);
00251         }
00252         else
00253         {
00254             await WebsiteDotNetCliHelper.StartNewCSharpProjectCommand(
00255                     immutableView,
00256                     EnvironmentProvider,
00257                     FileSystemProvider,
00258                     CompilerServicesBackgroundTaskApi,
00259                     Dispatcher,
00260                     DialogRecord,
00261                     LuthetusCommonComponentRenderers)
